    h5.dt-sc-toggle:before,
    h5.dt-sc-toggle-accordion:before {
        content: "\f107";
        font-family: fontawesome, "Stroke-Gap-Icons";
        height: 100%;
        left: 0;
        position: absolute;
        text-align: center;
        top: 2px;
        width: 50px;
        border-radius: 2px 0 0 2px;
        cursor: pointer;
        width: 30px;
        height: 30px;
        border: 2px solid;
        border-radius: 50%;
        line-height: 30px;
        z-index: 2
    }

    h5.dt-sc-toggle.active::before,
    h5.dt-sc-toggle-accordion.active:before {
        content: "\f106"
    }

    h5.dt-sc-toggle:after,
    h5.dt-sc-toggle-accordion:after {
        width: 40px;
        height: 106%;
        background-color: #fff;
        position: absolute;
        left: 0;
        top: 0;
        content: "";
        z-index: 1
    }

