        background: transparent;
        border: 0;
        font-size: 100%;
        margin: 0;
        outline: 0;
        padding: 0;
        vertical-align: baseline
    }

    article,
    aside,
    details,
    figcaption,
    figure,
    footer,
    header,
    hgroup,
    menu,
    nav,
    section {
        display: block
    }

    body {
        line-height: 1
    }

    abbr[title],
    dfn[title] {
        border-bottom: 1px dotted;
        cursor: help
    }

    blockquote,
    q {
        quotes: none
    }

    blockquote:before,
    blockquote:after,
    q:before,
    q:after {
        content: none
    }

    del {
        text-decoration: line-through
    }

    hr {
        background: transparent;
        border: 0;
        clear: both;
        color: transparent;
        height: 1px;
        margin: 0;
        padding: 0
    }

    mark {
        background-color: #ffffb3;
        font-style: italic
    }

    input,
    select {
        vertical-align: middle
    }

    ins {
        background-color: red;
        color: #fff;
        text-decoration: none
    }

    ol,
    ul {
        list-style: none
    }

    table {
        border-collapse: collapse;
        border-spacing: 0
    }

