    .blog-overlay {
        height: 100%;
        left: 0;
        position: absolute;
        top: 0;
        width: 100%;
        z-index: 9;
        opacity: 0;
        filter: alpha(opacity=0);
        text-align: center
    }

    .blog-post .entry-thumb-meta:hover .blog-overlay {
        opacity: 1;
        filter: alpha(opacity=1)
    }

    .blog-overlay:before {
        position: absolute;
        bottom: 0;
        left: 0;
        width: 100%;
        height: 80%;
        background: -webkit-linear-gradient(top, rgba(51, 51, 51, 0) 0%, rgba(51, 51, 51, .8) 75%);
        background: linear-gradient(to bottom, rgba(51, 51, 51, 0) 0%, rgba(51, 51, 51, .8) 75%);
        content: '';
        opacity: 0;
        -webkit-transform: translate3d(0, 50%, 0);
        transform: translate3d(0, 50%, 0);
        -webkit-transition: opacity 0.35s, -webkit-transform 0.35s;
        transition: opacity 0.35s, transform 0.35s;
        opacity: 0;
        filter: alpha(opacity=0)
    }

    .ie9 .blog-overlay:before {
        background: rgba(0, 0, 0, .3);
        height: 100%
    }

    .blog-post .entry-thumb-meta:hover .blog-overlay:before {
        opacity: 1;
        -webkit-transform: scale(1);
        transform: scale(1);
        -webkit-transform: translate3d(0, 0, 0);
        transform: translate3d(0, 0, 0);
        filter: alpha(opacity=1)
    }

    .blog-overlay a {
        width: 60px;
        height: 60px;
        border-radius: 50%;
        display: inline-block;
        position: absolute;
        left: 0;
        right: 0;
